import React, { Component } from "react";

export default class PlaceOrder extends Component {
    constructor(props) {
        super(props);
        this.handleSubmitOrder = this.handleSubmitOrder.bind(this);

        // Get tutorial data from URL parameters
        const params = new URLSearchParams(window.location.search);
        this.state = {
            title: params.get('title') || '',
            description: params.get('description') || '',
            status: params.get('status') || '',
            submitted: false,
            isValid: true,
            errorMessage: '',
            selectedProduct: '',
            // Add sample products (you can replace this with API data)
            products: [
                { id: 1, name: "Product A", price: 99.99 },
                { id: 2, name: "Product B", price: 149.99 },
                { id: 3, name: "Product C", price: 199.99 }
            ]
        };
    }

    handleSubmitOrder() {
        if (!this.state.title.trim() || !this.state.description.trim() || !this.state.selectedProduct) {
            this.setState({
                isValid: false,
                errorMessage: 'All fields including product selection are required!'
            });
            return;
        }

        this.setState({ submitted: true });
        // Add your order submission logic here
        alert("Order submitted successfully!");
        window.close();
    }

    handleInputChange = (e) => {
        const { name, value } = e.target;
        this.setState({
            [name]: value,
            isValid: true,
            errorMessage: ''
        });
    }

    render() {
        return (
            <div className="container">
                {!this.state.submitted ? (
                    <div>
                        <h2 className="text-center">Order Details</h2>
                        <div className="card">
                            <div className="card-body">
                                {!this.state.isValid && (
                                    <div className="alert alert-danger" role="alert">
                                        {this.state.errorMessage}
                                    </div>
                                )}

                                <div className="form-group mb-3">
                                    <label><strong>Product:</strong></label>
                                    <select
                                        className="form-control"
                                        name="selectedProduct"
                                        value={this.state.selectedProduct}
                                        onChange={this.handleInputChange}
                                    >
                                        <option value="">Select a product</option>
                                        {this.state.products.map(product => (
                                            <option key={product.id} value={product.name}>
                                                {product.name} - ${product.price}
                                            </option>
                                        ))}
                                    </select>
                                </div>

                                <div className="form-group mb-3">
                                    <label><strong>SalesPersonId:</strong></label>
                                    <input
                                        type="text"
                                        className="form-control"
                                        name="title"
                                        value={this.state.title}
                                        onChange={this.handleInputChange}
                                        placeholder="Enter title"
                                    />
                                </div>

                                <div className="form-group mb-3">
                                    <label><strong>Description:</strong></label>
                                    <textarea
                                        className="form-control"
                                        name="description"
                                        value={this.state.description}
                                        onChange={this.handleInputChange}
                                        rows="3"
                                        placeholder="Enter description"
                                    />
                                </div>

                                <div className="form-group mb-3">
                                    <label><strong>Status:</strong></label>
                                    <select
                                        className="form-control"
                                        name="status"
                                        value={this.state.status}
                                        onChange={this.handleInputChange}
                                    >
                                        <option value="Pending">Pending</option>
                                        <option value="Published">Published</option>
                                    </select>
                                </div>

                                <div className="text-center mt-3">
                                    <button
                                        className="btn btn-success"
                                        onClick={this.handleSubmitOrder}
                                    >
                                        Submit Order
                                    </button>
                                </div>
                            </div>
                        </div>
                    </div>
                ) : (
                    <div className="card mt-4">
                        <div className="card-body text-center">
                            <div className="alert alert-success" role="alert">
                                <h4 className="alert-heading">Order Submitted Successfully!</h4>
                            </div>
                            <div>
                                <h5>Order Details:</h5>
                                <p><strong>Product:</strong> {this.state.selectedProduct}</p>
                                <p><strong>Title:</strong> {this.state.title}</p>
                                <p><strong>Description:</strong> {this.state.description}</p>
                                <p><strong>Status:</strong> {this.state.status}</p>
                            </div>
                        </div>
                    </div>
                )}
            </div>
        );
    }
}
